> Florida Overhaul of Florida's districts hurts would-be House speaker Rep. Daniel Webster, R-Fla., right, leaves a House Republican special leadership election meeting on Capitol Hill in Washington, Thursday, Oct. 8, 2015, to replace House Speaker John Boehner, R-Ohio, who is stepping down, and retiring from Congress, at the end of the month, after nearly five years in the role. House Majority Leader Kevin McCarthy is the front-runner in the race to become the next speaker, but he faces two Republican opponents who are trying to draw some of his support. Four-term Rep. Jason Chaffetz of Utah and three-term Rep. Daniel Webster of Florida both say they can bring a needed fresh perspective to GOP leadership, unlike McCarthy, who has served as majority leader under Speaker John Boehner, R-Ohio. (AP Photo/Andrew Harnik) 
